import React from "react";

function Home() {
  return (
    <div className="home-container">
      <div className="home-content">
        <div className="home-bg">
          <div className="home-display"></div>
          <div className="home-items">
            <div className="home-item">
              <img />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
